import { Routes } from "./routes/Routes";
import "./utils/css/Global.css"
import { UserProvider } from "./utils/provider/UserProvider";
import { Navigation } from './components/navigation/Navigation'
import { CharacterInfoProvider } from "./utils/provider/CharacterInfoProvider";

function App() {
  return (
    <CharacterInfoProvider>
    <UserProvider>
    <Routes>
      <Navigation/>    
    </Routes>
    </UserProvider>
    </CharacterInfoProvider>
  );
}

export default App;
